	function LanguageSelection()
	{
		this.id = "avalibleLanguages";
		this.languages;
		this.i = 0;
	}
	
	LanguageSelection.prototype =
	{
		constructor:LanguageSelection,
		
		init:function()
		{
			this.getAvalibleLanguages();
			// = Package().avalibleLanguages;
			//this.language
			//new LanguageSelectionView();
		},
		
		getAvalibleLanguages:function()
		{
			storage = new Database();

			var data = storage.Select('avalibleLanguages');
			//alert(data);
			if(data === false)
			{
				this.getLanguages();
			}
			else
			{
				this.parseInfo(data);
			}
		},
		
		parseInfo: function(data)
		{
			thiz = this;
		
			$.each(data, function(key, value){
    			thiz[key] = value;
    			
			});
			var DB = new Database();
			DB.insert(thiz);
			thiz.draw();
		},
		
		getLanguages:function()
		{
			var url = "/applicationapi/language/get/avalibleLanguages";  
			thiz = this
			
			
			
			var tosend = {'token': activeuser.token , 'supportLanguage': activeuser.user_language }
		
		
			me = this; 
			var connection = new Connection();
			var response = connection.sumbitData(url , tosend , function(data){me.parseInfo(data)});
		},
		
		
		draw:function()
		{
			this.view = new LanguageSelectionView(this.languages);
			this.pageObjs = this.view.drawSelectionTable();
			this.AddPage();
			this.loadPage();
		},
		
		loadPage:function()
		{
			this.delayedLoop2(0);
		},
		
		AddPage:function()
		{
			that = this; 
			for(var i = 0 ; i < this.pageObjs.length; i++)
			{	
				this.EventHover(this.pageObjs[i]['set'] , this.pageObjs[i]['x'] , this.pageObjs[i]['y']);
				
				this.EventClick(this.pageObjs[i]['set'] , this.pageObjs[i]['prefix']);
			}
		},
		
		EventHover:function(set , x , y)
		{
		
			function over(){set.items[1].animate({transform: "t"+x+","+(y+50)+"S1.25 , S1.25"}, 80); };
			function out (){set.items[1].animate({transform: "t"+x+","+(y+50)+"S1.2 , S1.2"}, 80);  };
		
    		set.items[1].hover(over , out);
    		
		
		},
		
		delayedLoop:function(i)
		{
			var me = this 
			
			me.move(me.pageObjs[i]['set']);
			

			if(++i >= me.pageObjs.length)
			{
						// exit cycle is complete draw new screen; 
					var l = new LanguageSelection();
					l.init();
					return; 
			}
			
			//alert(i);
			//setTimeout( function ()
			//{
				me.delayedLoop(i)
			//}, 100);
			
		},
		
		delayedLoop2:function(i)
		{
			var me = this 
			
			//me.move(me.pageObjs[i]['set']);
			
			me.pageObjs[i]['set'].items[1].animate({transform: "T"+me.pageObjs[i]['x']+","+(me.pageObjs[i]['y']+50)+"S1.2 , S1.2"}, 800);
			me.pageObjs[i]['set'].items[0].animate({transform: "T"+(me.pageObjs[i]['x'])+","+(me.pageObjs[i]['y']-105)+"S1 , S1"}, 800);
			
			if(++i >= me.pageObjs.length)
			{
					return; 
			}
			
			//alert(i);
			//setTimeout( function ()
			//{
				me.delayedLoop2(i)
			//}, 100);
			
		},
		
		EventClick:function(set , language)
		{
			var me = this 
			
			function clicked()
			{
				activeuser.currentLanguage = language;
				me.delayedLoop(0);
			};
			
    		set.items[1].click(clicked);
		
		}, 
		
		move:function(set)
		{
			set.unhover();
			set.animate({transform: "t-900, 0"}, 1200 , function(){ this.remove(); })
		}
		
	}